port: 7890
socks-port: 7891
mixed-port: 7892
allow-lan: true
mode: rule
log-level: info
external-controller: '0.0.0.0:9090'
clash-for-android:
    append-system-dns: false
profile:
    tracing: true
dns:
    enable: true
    enhanced-mode: fake-ip
    ipv6: false
    default-nameserver: [223.5.5.5, 119.29.29.29]
    fake-ip-range: 198.18.0.1/16
    use-hosts: true
    nameserver: ['https://doh.pub/dns-query', 'https://dns.alidns.com/dns-query']
    fallback: ['https://doh.dns.sb/dns-query', 'https://dns.cloudflare.com/dns-query', 'https://dns.twnic.tw/dns-query', 'tls://1.0.0.1:853', 'tls://8.8.4.4:853']
    fallback-filter: { geoip: true, ipcidr: [240.0.0.0/4, 0.0.0.0/32] }

proxy-providers:
  vps:
    type: file
    path: ./vps.yaml
    health-check:
      enable: true
      url: http://www.gstatic.com/generate_204
      interval: 300
  wangzi:
    type: file
    path: ./wangzi.yaml
    interval: 86400
    health-check:
      enable: true
      url: http://www.gstatic.com/generate_204
      interval: 300
  byg:
    type: file
    path: ./byg.yaml
    interval: 86400
    health-check:
      enable: true
      url: http://www.gstatic.com/generate_204
      interval: 300
  USA:
    type: file
    path: ./byg.yaml
    filter: '美国'

proxy-groups:
    - { name: '🚀 手动切换', use: [byg, vps, wangzi], type: select}
    - { name: '📲 电报消息', use: [byg, vps, wangzi], type: select, proxies: ['🚀 手动切换'] }
    - { name: '📹 油管视频', use: [byg, vps, wangzi], type: select, proxies: ['🚀 手动切换'] }
    - { name: 'Ⓜ️ 微软服务', use: [byg, vps, wangzi], type: select, proxies: [DIRECT, '🚀 手动切换'] }
    - { name: '🍎 苹果服务', use: [byg, vps, wangzi], type: select, proxies: [DIRECT, '🚀 手动切换'] }
    - { name: '📧 SSH邮件', use: [byg, vps, wangzi], type: select, proxies: [DIRECT] }
    - { name: '💻 AI GPT', use: [USA], type: select, proxies: ['🚀 手动切换'] }
    - { name: '🎯 全球直连', type: select, proxies: [DIRECT, '🚀 手动切换'] }
    - { name: '🐟 漏网之鱼', use: [byg, vps, wangzi], type: select, proxies: ['🚀 手动切换', DIRECT] }
